INSERT INTO `berita` (`id`, `judul_berita`, `isi_berita`, `thumbnail`, `gambar_berita`, `slug_berita`, `create_berita`) VALUES
(1, 'Sejarah Desa Hulusobo', '<h1 style=\"text-align:center\"><span style=\"font-family:Trebuchet MS,Helvetica,sans-serif\"><span style=\"font-size:28px\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></span><span style=\"font-size:12px\">Hulosobo adalah sebuah nama desa pegunungan, berada di perbukitan menoreh.Penduduk pertama yang menjadi cikal bakal berdirinya desa hulosobo adalah seorang prajurit pelarian dari mataram/Jogjakarta pada saat perang Diponegoro sekitar tahun 1800-an.Secara semantik, Pelarian dapat diartikan sobo, sedangkan orangnya disebut kawulo. Kata kawulo sobo inilah yang sekarang menjadi Hulosobo, seiring dengan penyesuaian lafal manusia. Desa Hulosobo menyimpan sejarah perang kemerdekaan sekitar tahun 1949-an, saat bupati Purworejo mengungsi di desa Hulosobo karena kejaran tentara Belanda. Tempat pengungsian ini berada di dukuh gebang yg terkenal dengan Karang Kaendran.Saat tentara membombardir tempat ini ternyata meleset, karena bom jatuhnya di sekitar kecamatan Kaligesing.Selamatlah bupati Cokronegoro dari serangan Belanda, kemudian beliau membuat prasasti mengenai keberadaannya di Karang Kaendran desa Hulosobo.Sayang, karena ketidaktahuan penduduk, prasasti ini dihancurkan untuk fondasi rumah. Pemerintah desa Hulosobo berinisiatif untuk membuat tiruan atau replika prasasti Karang Kaendran untuk mengenang sejarah.</span></span></h1>\n\n<p><span style=\"font-family:Trebuchet MS,Helvetica,sans-serif\"><span style=\"font-size:12px\">Desa Hulosobo mempunyai berbagai kesenian tradisional. Namun yang saat ini sedang populer adalah kesenian tradisional kuda lumping &quot;WIDOTOMO&quot;.</span></span></p>\n\n<p><span style=\"font-family:Trebuchet MS,Helvetica,sans-serif\"><span style=\"font-size:12px\">Desa Hulosobo terbagi menjadi 4 Rw.</span></span></p>\n', 'Â Hulosobo adalah sebuah nama desa pegunungan, berada di perbukitan menoreh.Penduduk pertama yang menjadi cikal bakal berdirinya desa hulosobo adalah seorang prajurit pelarian dari mataram/Jogjakarta pada saat perang Diponegoro sekitar tahun 1800-an.Secara semantik, Pelarian dapat diartikan sobo, sedangkan orangnya disebut kawulo. Kata kawulo sobo inilah yang sekarang menjadi Hulosobo, seiring dengan penyesuaian lafal manusia.', , 'sejarah-desa', '2020-06-05');
INSERT INTO `berita` (`id`, `judul_berita`, `isi_berita`, `thumbnail`, `gambar_berita`, `slug_berita`, `create_berita`) VALUES
(2, 'Visi Dan Misi Desa Hulusobo', '<p style=\"text-align:center\">&nbsp;</p>\n\n<p style=\"text-align:center\"><strong>&nbsp;VISI</strong></p>\n\n<p><strong>KERTA RAHARJA</strong>&nbsp;artinya Mewujudkan Desa Akah yang damai dan Sentosa , Sejahtera , sehat , demokratis berbasis pada ekonomi pertanian , kerajinan dan pariwisata.</p>\n\n<p>Visi adalah suatu gambaran umum tentang keadaan masa depan yang ingin dicapai dengan melihat potensi dan kebutuhan desa. Maka konsep Visi Pembangunan Desa dalam kurun waktu 2020 hingga 2025.</p>\n\n<p style=\"text-align:center\"><strong>MISI</strong></p>\n\n<p style=\"text-align:center\">1. Mengutamakan pemberdayaan potensi pertanian untuk menunjang sumber pendapatan dan kesejahteraan masyarakat desa sebagai sentra kegiatan pokok.<br />\n2. Meningkatkan kualitas Sumber Daya Manusia melalui Program pendidikan dan program kesehatan serta pengamalan ajaran agama kepada masyarakat.<br />\n3.Menggali , melestarikan dan mengembangkan nilai - nilai&nbsp; budaya desa<br />\n4. Meningkatkan ketahanan ekonomi dengan menggalakkan usaha ekonomi kerakyatan melalui program strategi dibidang produksi ekonomi pertanian , kerajinan, pariwisata.<br />\n5. Meningkatkan partisipasi masyarakat dalam menumbuh kembangkan kesadaran dan kemandirian dalam&nbsp; pembangunan desa yang berkelanjutan.<br />\n6. Menciptakan suasana yang aman dan tertib dalam kehidupan bermasyarakat.<br />\n7. Meningkatkan pelayanan kepada masyarakat dan kerjasama anat lembaga pemerintahan di desa serta lembaga adat.<br />\n8. Memberdayakan masyarakat dengan mengoptimalkan potensi yang ada menuju masyarakat mandiri dan sejahtera.</p>\n\n<p style=\"text-align:center\"><strong>TUJUAN</strong></p>\n\n<p>Meningkatkan taraf hidup masyarakat yang mencakup bidang kesehatan, bidang pendidikan sosial dan aspek kehidupan lainnya sehingga kesejahteraan masyarakat dapat tercapai sesuai dengan harapan kita semua.</p>\n\n<p style=\"text-align:center\"><strong>SASARAN</strong></p>\n\n<p>Seluruh masyarakat Desa Akah sehingga masyarakat dapat bekerja lebih optimal serta penghasilan dapat meningkat.</p>\n', 'Â VISI  KERTA RAHARJAÂ artinya Mewujudkan Desa Akah yang damai dan Sentosa , Sejahtera , sehat , demokratis berbasis pada ekonomi pertanian , kerajinan dan pariwisata.  Visi adalah suatu gambaran umum tentang keadaan masa depan yang ingin dicapai dengan melihat potensi dan kebutuhan desa. Maka konsep Visi Pembangunan Desa dalam kurun waktu 2020 hingga 2025.  MISI', , 'visi-misi', '2020-06-11');
