INSERT INTO `berita` (`id`, `judul_berita`, `isi_berita`, `thumbnail`, `gambar_berita`, `slug_berita`, `create_berita`) VALUES
(4, 'Pemerintahan Desa', '<p style=\"text-align:center\"><strong>SUSUNAN ORGANISASI DAN TATA KERJA PEMERINTAH DESA</strong></p>\n\n<p style=\"text-align:center\"><strong>DESA HULUSOBO&nbsp;&nbsp;KECAMATAN KALIGESING KABUPATEN PURWOREJO</strong></p>\n\n<p>&nbsp;&nbsp;</p>\n\n<p>Kepala Desa bertugas menyelenggarakan Pemerintahan Desa, melaksanakan pembangunan, pembinaan kemasyarakatan, dan pemberdayaan masyarakat. Untuk melaksanakan tugas Kepala Desa memiliki fungsi-fungsi sebagai berikut:</p>\n\n<ol>\n	<li>Menyelenggarakan Pemerintahan Desa, seperti tata praja Pemerintahan, penetapan peraturan di desa, pembinaan masalah pertanahan, pembinaan ketentraman dan ketertiban, melakukan upaya perlindungan masyarakat, administrasi kependudukan, dan penataan dan pengelolaan wilayah.</li>\n	<li>Melaksanakan pembangunan, seperti pembangunan sarana prasarana perdesaan, dan pembangunan bidang pendidikan, kesehatan.</li>\n	<li>Pembinaan kemasyarakatan, seperti pelaksanaan hak dan kewajiban masyarakat, partisipasi masyarakat, sosial budaya masyarakat, keagamaan, dan ketenagakerjaan.</li>\n	<li>Pemberdayaan masyarakat, seperti tugas sosialisasi dan motivasi masyarakat di bidang budaya, ekonomi, politik, lingkungan hidup, pemberdayaan keluarga, pemuda, olahraga, dan karang taruna.</li>\n	<li>Menjaga hubungan kemitraan dengan lembaga masyarakat dan lembaga lainnya.</li>\n</ol>\n\n<p>&nbsp;Sekretaris Desa berkedudukan sebagai unsur pimpinan Sekretariat Desa. Sekretaris Desa bertugas membantu Kepala Desa dalam bidang administrasi pemerintahan. Untuk melaksanakan tugas, Sekretaris Desa mempunyai fungsi:</p>\n\n<ol>\n	<li>Melaksanakan urusan ketatausahaan seperti tata naskah, administrasi surat menyurat, arsip, dan ekspedisi.</li>\n	<li>Melaksanakan urusan umum seperti penataan administrasi perangkat desa, penyediaan prasarana perangkat desa dan kantor, penyiapan rapat, pengadministrasian aset, inventarisasi, perjalanan dinas, dan pelayanan umum.</li>\n	<li>Melaksanakan urusan keuangan seperti pengurusan administrasi keuangan, administrasi sumber-sumber pendapatan dan pengeluaran, verifikasi administrasi keuangan, dan admnistrasi penghasilan Kepala Desa, Perangkat Desa, BPD, dan lembaga pemerintahan desa lainnya.</li>\n	<li>Melaksanakan urusan perencanaan seperti menyusun rencana anggaran pendapatan dan belanja desa, menginventarisir data-data dalam rangka pembangunan, melakukan monitoring dan evaluasi program, serta penyusunan laporan.</li>\n</ol>\n\n<p>Kepala urusan berkedudukan sebagai unsur staf sekretariat. Kepala urusan bertugas membantu Sekretaris Desa dalam urusan pelayanan administrasi pendukung pelaksanaan tugas-tugas pemerintahan. Untuk melaksanakan tugas kepala urusan mempunyai fungsi:</p>\n\n<ol>\n	<li>Kepala urusan tata usaha dan umum memiliki fungsi seperti melaksanakan urusan ketatausahaan seperti tata naskah, administrasi surat menyurat, arsip, dan ekspedisi, dan penataan administrasi perangkat desa, penyediaan prasarana perangkat desa dan kantor, penyiapan rapat, pengadministrasian aset, inventarisasi, perjalanan dinas, dan pelayanan umum.</li>\n	<li>Kepala urusan keuangan memiliki fungsi seperti melaksanakan urusan keuangan seperti pengurusan administrasi keuangan, administrasi sumber-sumber pendapatan dan pengeluaran, verifikasi administrasi keuangan, dan admnistrasi penghasilan Kepala Desa, Perangkat Desa, BPD, dan lembaga pemerintahan desa lainnya.</li>\n	<li>Kepala urusan perencanaan memiliki fungsi mengoordinasikan urusan perencanaan seperti menyusun rencana anggaran pendapatan dan belanja desa, menginventarisir data-data dalam rangka pembangunan, melakukan monitoring dan evaluasi program, serta penyusunan laporan.</li>\n</ol>\n\n<p>Kepala Kewilayahan atau sebutan lainnya berkedudukan sebagai unsur satuan tugas kewilayahan yang bertugas membantu Kepala Desa dalam pelaksanaan tugasnya di wilayahnya. Untuk melaksanakan tugas Kepala Kewilayahan/Kepala Dusun memiliki fungsi:</p>\n\n<ol>\n	<li>Pembinaan ketentraman dan ketertiban, pelaksanaan upaya perlindungan masyarakat, mobilitas kependudukan, dan penataan dan pengelolaan wilayah.</li>\n	<li>Mengawasi pelaksanaan pembangunan di wilayahnya.</li>\n	<li>Melaksanakan pembinaan kemasyarakatan dalam meningkatkan kemampuan dan kesadaran masyarakat dalam menjaga lingkungannya.</li>\n	<li>Melakukan upaya-upaya pemberdayaan masyarakat dalam menunjang kelancaran penyelenggaraan pemerintahan dan pembangunan.</li>\n</ol>\n\n<p>Kepala seksi berkedudukan sebagai unsur pelaksana teknis. Kepala seksi bertugas membantu Kepala Desa sebagai pelaksana tugas operasional. Untuk melaksanakan tugas Kepala Seksi mempunyai fungsi:</p>\n\n<ol>\n	<li>Kepala seksi pemerintahan mempunyai fungsi melaksanakan manajemen tata praja Pemerintahan, menyusun rancangan regulasi desa, pembinaan masalah pertanahan, pembinaan ketentraman dan ketertiban, pelaksanaan upaya perlindungan masyarakat, kependudukan, penataan dan pengelolaan wilayah, serta pendataan dan pengelolaan Profil Desa.</li>\n	<li>Kepala seksi kesejahteraan mempunyai fungsi melaksanakan pembangunan sarana prasarana perdesaan, pembangunan bidang pendidikan, kesehatan, dan tugas sosialisasi serta motivasi masyarakat di bidang budaya, ekonomi, politik, lingkungan hidup, pemberdayaan keluarga, pemuda, olahraga, dan karang taruna.</li>\n	<li>Kepala seksi pelayanan memiliki fungsi melaksanakan penyuluhan dan motivasi terhadap pelaksanaan hak dan kewajiban masyarakat, meningkatkan upaya partisipasi masyarakat, pelestarian nilai sosial budaya masyarakat, keagamaan, dan ketenagakerjaan.</li>\n</ol>\n\n<p>Sumber : PERMENDAGRI NOMOR 84 TAHUN 2015 TENTANG SUSUNAN ORGANISASI DAN TATA KERJA PEMERINTAH DESA</p>\n', 'SUSUNAN ORGANISASI DAN TATA KERJA PEMERINTAH DESA  DESA HULUSOBOÂ Â KECAMATAN KALIGESING KABUPATEN PURWOREJO  Â Â   Kepala Desa bertugas menyelenggarakan Pemerintahan Desa, melaksanakan pembangunan, pembinaan kemasyarakatan, dan pemberdayaan masyarakat. Untuk melaksanakan tugas Kepala Desa memiliki fungsi-fungsi sebagai berikut:', , 'pemerintahan-desa', '2020-06-11');
INSERT INTO `berita` (`id`, `judul_berita`, `isi_berita`, `thumbnail`, `gambar_berita`, `slug_berita`, `create_berita`) VALUES
(8, 'tentang Badan Permusyawaratan Desa (BPD)', '<h1 style=\"text-align:center\"><strong>Badan Permusyawaratan Desa</strong></h1>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Secara yuridis, tugas Badan Permusyawaratan Desa mengacu kepada regulasi desa yakni Undang-Undang Nomor 6 Tahun 2014 tentang Desa.&nbsp;</p>\n\n<p>Badan Permusyawaratan Desa yang selanjutnya disingkat BPD atau yang disebut dengan nama lain adalah lembaga yang melaksanakan fungsi pemerintahan yang anggotanya merupakan wakil dari penduduk Desa berdasarkan keterwakilan wilayah dan ditetapkan secara demokratis.</p>\n\n<p>Dalam Permendagri No.110/2016 Badan Permusyawaratan Desa mempunyai fungsi, membahas dan menyepakati Rancangan Peraturan Desa bersama Kepala Desa, menampung dan menyalurkan aspirasi masyarakat Desa, dan melakukan pengawasan kinerja Kepala Desa.</p>\n\n<p>Selain melaksanakan fungsi diatas, Badan Permusyawaratan Desa juga mempunyai tugas sebagai berikut.</p>\n\n<p>BPD mempunyai fungsi:</p>\n\n<ol>\n	<li>membahas dan menyepakati Rancangan Peraturan Desa bersama Kepala Desa;</li>\n	<li>menampung dan menyalurkan aspirasi masyarakat Desa; dan</li>\n	<li>melakukan pengawasan kinerja Kepala Desa.</li>\n</ol>\n\n<p>BPD mempunyai tugas:</p>\n\n<ol>\n	<li>menggali aspirasi masyarakat;</li>\n	<li>menampung aspirasi masyarakat;</li>\n	<li>mengelola aspirasi masyarakat;</li>\n	<li>menyalurkan aspirasi masyarakat;</li>\n	<li>menyelenggarakan musyawarah BPD;</li>\n	<li>menyelenggarakan musyawarah Desa;</li>\n	<li>membentuk panitia pemilihan Kepala Desa;</li>\n	<li>menyelenggarakan musyawarah Desa khusus untuk pemilihan Kepala Desa antarwaktu;</li>\n	<li>membahas dan menyepakati rancangan Peraturan Desa bersama Kepala Desa;</li>\n	<li>melaksanakan pengawasan terhadap kinerja Kepala Desa;</li>\n	<li>melakukan evaluasi laporan keterangan penyelenggaraan Pemerintahan Desa;</li>\n	<li>menciptakan hubungan kerja yang harmonis dengan Pemerintah Desa dan lembaga Desa lainnya; dan</li>\n	<li>melaksanakan tugas lain yang diatur dalam ketentuan peraturan perundang-undangan.</li>\n</ol>\n\n<p>Sumber : PERMENDAGRI NOMOR 110 TENTANG BADAN PERMUSYAWARATAN DESA</p>\n', 'Badan Permusyawaratan Desa     Secara yuridis, tugas Badan Permusyawaratan Desa mengacu kepada regulasi desa yakni Undang-Undang Nomor 6 Tahun 2014 tentang Desa.', , 'badan-permusyawaratan', '2020-06-17');
INSERT INTO `berita` (`id`, `judul_berita`, `isi_berita`, `thumbnail`, `gambar_berita`, `slug_berita`, `create_berita`) VALUES
(9, 'LPM', '<p>Lembaga Pemberdayaan Masyarakat (LPM) adalah salah satu lembaga kemasyaratan yang berada di desa. Lembaga Pemberdayaan Masyarakat mempunyai tugas menyusun rencana pembangunan secara partisipatif, menggerakkan swadaya gotong royong masyarakat, melaksanakan dan mengendalikan pembangunan.</p>\n\n<p><strong>FUNGSI LPM</strong></p>\n\n<ol>\n	<li>penampungan dan penyaluran aspirasi masyarakat dalam pembangunan;</li>\n	<li>penanaman dan pemupukan rasa persatuan dan kesatuan masyarakat dalam kerangka memperkokoh Negara Kesatuan Republik Indonesia;</li>\n	<li>peningkatan kualitas dan percepatan pelayanan pemerintah kepada masyarakat;</li>\n	<li>penyusunan rencana, pelaksanaan, pelestarian dan pengembangan hasil-hasil pembangunan secara partisipatif;</li>\n	<li>penumbuhkembangan dan penggerak prakarsa, partisipasi, serta swadaya gotong royong masyarakat; dan</li>\n	<li>penggali, pendayagunaan dan pengembangan potensi sumber daya alam serta keserasian lingkungan hidup.</li>\n</ol>\n', 'Lembaga Pemberdayaan Masyarakat (LPM) adalah salah satu lembaga kemasyaratan yang berada di desa. Lembaga Pemberdayaan Masyarakat mempunyai tugas menyusun rencana pembangunan secara partisipatif, menggerakkan swadaya gotong royong masyarakat, melaksanakan dan mengendalikan pembangunan.  FUNGSI LPM  penampungan dan penyaluran aspirasi masyarakat dalam pembangunan; penanaman dan pemupukan rasa persatuan dan kesatuan masyarakat dalam kerangka memperkokoh Negara Kesatuan Republik Indonesia; peningkatan kualitas dan percepatan pelayanan pemerintah kepada masyarakat;', , 'lpm', '2020-06-24');
INSERT INTO `berita` (`id`, `judul_berita`, `isi_berita`, `thumbnail`, `gambar_berita`, `slug_berita`, `create_berita`) VALUES
(10, 'Karang Taruna', '<p><strong>TUGAS &nbsp;KARANGTARUNA</strong></p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; menanggulangi berbagai masalah kesejahteraan sosial terutama yang dihadapi generasi muda, baik yang bersifat preventif, rehabilitatif, maupun pengembangan potensi generasi muda di lingkungannya</p>\n\n<p><strong>FUNGSI KARANGTARUNA</strong></p>\n\n<ol>\n	<li>\n	<p>penyelenggara usaha kesejahteraan sosial;</p>\n	</li>\n	<li>\n	<p>penyelenggara pendidikan dan pelatihan bagi masyarakat;</p>\n	</li>\n	<li>\n	<p>penyelenggara pemberdayaan masyarakat terutama generasi muda di lingkungannya secara komprehensif, terpadu dan terarah serta berkesinambungan;</p>\n	</li>\n	<li>\n	<p>penyelenggara kegiatan pengembangan jiwa kewirausahaan bagi generasi muda di lingkungannya;</p>\n	</li>\n	<li>\n	<p>penanaman pengertian, memupuk dan meningkatkan kesadaran tanggung jawab sosial generasi muda;</p>\n	</li>\n	<li>\n	<p>penumbuhan dan pengembangan semangat kebersamaan, jiwa kekeluargaan, kesetiakawanan sosial dan memperkuat nilai-nilai kearifan dalam bingkai Negara Kesatuan Republik Indonesia;</p>\n	</li>\n	<li>\n	<p>pemupukan kreatifitas generasi muda untuk dapat mengembangkan tanggung jawab sosial yang bersifat rekreatif, kreatif, edukatif, ekonomis produktif dan kegiatan praktis lainnya dengan mendayagunakan segala sumber dan potensi kesejahteraan sosial di lingkungannya secara swadaya;</p>\n	</li>\n	<li>\n	<p>penyelenggara rujukan, pendampingan dan advokasi sosial bagi penyandang masalah kesejahteraan sosial;</p>\n	</li>\n	<li>\n	<p>penguatan sistem jaringan komunikasi, kerjasama, informasi dan kemitraan dengan berbagai sektor lainnya;</p>\n	</li>\n	<li>\n	<p>penyelenggara usaha-usaha pencegahan permasalahan sosial yang aktual;</p>\n	</li>\n	<li>\n	<p>pengembangan kreatifitas remaja, pencegahan kenakalan, penyalahgunaan obat terlarang (narkoba) bagi remaja; dan</p>\n	</li>\n	<li>\n	<p>penanggulangan masalah-masalah sosial, baik secara preventif, rehabilitatif dalam rangka pencegahan kenakalan remaja, penyalahgunaan obat terlarang (narkoba) bagi remaja.</p>\n	</li>\n</ol>\n', 'TUGAS Â KARANGTARUNA  Â  Â  Â  Â  Â  Â  Â  menanggulangi berbagai masalah kesejahteraan sosial terutama yang dihadapi generasi muda, baik yang bersifat preventif, rehabilitatif, maupun pengembangan potensi generasi muda di lingkungannya', , 'karang-taruna', '2020-06-24');
INSERT INTO `berita` (`id`, `judul_berita`, `isi_berita`, `thumbnail`, `gambar_berita`, `slug_berita`, `create_berita`) VALUES
(11, 'PKK', '<ol>\n	<li>menyusun rencana kerja PKK Desa/Kelurahan, sesuai dengan basil Rakerda Kabupaten/Kota;</li>\n	<li>melaksanakan kegiatan sesuai jadwal yang disepakati;</li>\n	<li>menyuluh dan menggerakkan kelompok-kelompok PKK Dusun/Lingkungan, RW, RT dan dasa wisma agar dapat mewujudkan kegiatan-kegiatan yang telah disusun dan disepakati;</li>\n	<li>menggali, menggerakan dan mengembangkan potensi masyarakat, khususnya keluarga untuk meningkatkan kesejahteraan keluarga sesuai dengan kebijaksanaan yang telah ditetapkan;</li>\n	<li>melaksanakan kegiatan penyuluhan kepada keluarga-keluarga yang mencakup kegiatan bimbingan dan motivasi dalam upaya mencapai keluarga sejahtera;.</li>\n	<li>mengadakan pembinaan dan bimbingan mengenai pelaksanaan program kerja;</li>\n	<li>berpartisipasi dalam pelaksanaan program instansi yang berkaitan dengan kesejahteraan keluarga di desa/kelurahan;</li>\n	<li>membuat laporan basil kegiatan kepada Tim Penggerak PKK Kecamatan dengan tembusan kepada Ketua Dewan Penyantun Tim Penggerak PKK setempat;</li>\n	<li>melaksanakan tertib administrasi; dan</li>\n	<li>mengadakan konsultasi dengan Ketua Dewan Penyantun Tim Penggerak PKK setempat.</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p><strong>FUNGSI PKK</strong></p>\n\n<ol>\n	<li>penyuluh, motivator dan penggerak masyarakat agar mau dan mampu melaksanakan program PKK; dan</li>\n	<li>fasilitator, perencana, pelaksana, pengendali, pembina dan pembimbing Gerakan PKK.</li>\n</ol>\n', 'menyusun rencana kerja PKK Desa/Kelurahan, sesuai dengan basil Rakerda Kabupaten/Kota; melaksanakan kegiatan sesuai jadwal yang disepakati; menyuluh dan menggerakkan kelompok-kelompok PKK Dusun/Lingkungan, RW, RT dan dasa wisma agar dapat mewujudkan kegiatan-kegiatan yang telah disusun dan disepakati;', , 'pkk', '2020-06-24');

